css:
@syntax-cursor-color : #d5fdd5 // @ghost-white;
.minimap .line .git-line-modified {
  background: rgba(230, 219, 116, 0.5);
}
.minimap .line .git-line-added {
  background: rgba(82, 155, 47, 0.6);
}
.minimap .line .git-line-removed {
  background: rgba(249, 38, 114, 0.7);
}
.minimap .gutter .git-line-modified {
  background: #E6DB74;
}
.minimap .gutter .git-line-added {
  background: #529B2F;
}
.minimap .gutter .git-line-removed {
  background: #F92672;
}
